import React from "react";
import Card from "./Card";
export default function Home(){
    const renderItems = () => {
        const itemComponents = [];
        for (let i = 0; i < cardText.length; i++) {
          itemComponents.push(
            <Card text={cardText[i]}/>
          );
        }
        return itemComponents;
      };
    return (
        <div className="container">
            {renderItems()}
        </div>
    )
}
